script: |
  super -f text -I q6450.spq | sort > q6450.out

inputs:
  - name: q6450.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN + col1 AND - - 76 + - 46 OR col0 / col2 IS NULL;
  - name: tab1

outputs:
  - name: q6450.out
    data: |
      51	14	96
      85	5	59
      91	47	68
